class Solution
{
public:
    bool isCon(int code1, int code2)
    {
        // x^p
        int code = code1 ^ code2;
        int count1 = 0;
        int count2 = 0;
        for (int i = 0; i < 26; i++)
        {
            if ((code & 1) == 1)
            {
                if ((code1 & (1 << i)) != 0)
                    count1++;
                else
                    count2++;
            }

            code = code >> 1;
        }
        return (count1 + count2) <= 2 && count1 < 2 && count2 < 2 ? true : false;
    }
    int encode(string word)
    {
        int res = 0;
        for (auto &ch : word)
        {
            res += (1 << ch - 'a');
        }
        return res;
    }
    int findRoot(vector<int> &fathers, int index)
    {
        int root = index;
        while (fathers[root] != -1)
        {
            root = fathers[root];
        }
        if (root != index)
            fathers[index] = root;
        return root;
    }

    void unionVec(vector<int> &fathers, vector<int> &count, int x_root, int y_root)
    {
        fathers[y_root] = x_root;
        count[x_root] += count[y_root];
    }

    vector<int> groupStrings(vector<string> &words)
    {
        // 并查集问题
        // 表示这个节点为root的树一共有多少节点

        unordered_map<int, int> code;
        unordered_map<int, int> fathers;
        unordered_map<int, int> count;
        int con = words.size();
        for (auto &word : words)
        {
            int retcode = encode(word);

            if (code.count(retcode))
            {
                code[retcode]++;
            }
            else
            {
                code[retcode] = 1;
            }
        }
        unordered_map<int, int>::iterator it;
        for (it = code.begin(); it != code.end(); it++)
        {
            fathers[it->first] = -1;
            // count[it->first] = it->second;
        }

        for (it = code.begin(); it != code.end(); it++)
        {
            fathers[it->first] = -1;
            // count[it->first] = it->second;
        }
        for (int i = 0; i < words.size(); i++)
        {
            int x_root = findRoot(fathers, i);
            for (int j = i + 1; j < words.size(); j++)
            {
                if (isCon(code[words[i]], code[words[j]]))
                {
                    int y_root = findRoot(fathers, j);

                    if (x_root != y_root)
                    {
                        unionVec(fathers, count, x_root, y_root);
                        con--;
                    }
                }
            }
        }
        // -1 的个数
        // count数
        vector<int> res(2, 0);
        res[0] = con;
        for (int i = 0; i < words.size(); i++)
        {
            res[1] = max(res[1], count[i]);
        }
        return res;
    }
};

